import React from "react";
import Card from "./Card.jsx";
import sdata from "./Sdata.jsx";


const favseries = "Netflix";
const Ncards = () =>{
    if (favseries === "Netflix"){

        return(<>

            <Card 
            key={sdata[0].id}
                src={sdata[0].src}
                title={sdata[0].title}
                details={sdata[0].details}
            
            />
            </>
            
            );
    }else{
        return(<>

            <Card 
            key={sdata[0].id}
                src={sdata[0].src}
                title={sdata[0].title}
                details={sdata[0].details}
            
            />
            </>
            
            );
    }
}
 const App =() =>{
     return(
         <>
            <Ncards/>
         </>
     );
    
 }

 export default App
